// app/chat/_layout.tsx
import { Stack } from "expo-router";

export default function ChatLayout() {
  return (
    <Stack>
      <Stack.Screen 
        name="room" 
        options={{ 
          title: "Chat Room",
          headerShown: true 
        }} 
      />
    </Stack>
  );
}
